import React, { useState, useEffect } from "react";

const One = () => {

    const [name,setname] = useState("sohail");

    function O(){
        setname("memon");
    }

    useEffect(() => {
        console.log("Clicked useeffect")
    })


    return(
        <React.Fragment>
            <h1>Hello Hook It's {name}</h1>
            <button onClick = {O}>Press</button>
        </React.Fragment>
    )
}

export default One;
